create table posts
(
    id             bigint generated by default as identity
        primary key,
    author         varchar(255),
    content        varchar(255) not null,
    created_at     timestamp,
    main_image     bytea,
    title          varchar(255) not null,
    main_image_url varchar(255)
);

alter table posts
    owner to postgres;

